app = FastAPI()
f = pipeline("fill-mask")
cloze = lambda snt, topk=10: [ (d['token_str'][1:], round(d['score'], 4)) for d in f(snt if '<mask>' in snt else f"<mask> snt",top_k=topk)]

@app.get('/')
def home(): return HTMLResponse(content=f"<h2> fill-mask:4.3.2 </h2> <a href='/docs'> docs </a> | <a href='/redoc'> redoc </a> <br>2021-2-11")

@app.get('/fillmask/get')
def fillmask_get(snt: str = 'We <mask> attention to it.', topk:int = 10):  
	return f(snt,top_k=topk)

@app.get('/fillmask/cloze')
def fillmask_cloze(snt: str = 'We <mask> attention to it.', topk:int = 10, pos:str=None): 
	if not pos: return cloze(snt,topk=topk) 
	ss = map.get(pos, {})
	return [(w,f) for w,f in cloze(snt,topk=1000)  if w in ss and f > 0 ]

@app.get('/fillmask/choice')
def fillmask_choice(snt: str = 'We <mask> attention to it.', targets:str='pay,paid,take'): 
	return f(snt, targets=targets.split(","))

if __name__ == '__main__':
	uvicorn.run(app, host='0.0.0.0', port=80)

